function RemoveButton(props) {

  const style = {
    background: "rgba(200,200,200,0.0)"
  };

  return (
    <a type="submit" name="action" onClick={props.onClick} style={style}>
      <i class="material-icons">remove</i>
    </a>
  );
}

export default RemoveButton;
